pub enum DecodingError {
    IoError(io::Error),
    Format(Cow),
    InvalidSignature,
    CrcMismatch {
        /// bytes to skip to try to recover from this error
        recover: usize,
        /// Stored CRC32 value
        crc_val: u32,
        /// Calculated CRC32 sum
        crc_sum: u32,
        chunk: ChunkType,
    },
    Other(Cow),
    CorruptFlateStream,
}
